import org.junit.Before;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.junit.runners.Parameterized;
import test1.Utils;

import java.util.Arrays;
import java.util.Collection;

import static org.junit.Assert.assertEquals;


@RunWith(Parameterized.class)
public class UtilsTest2 {
    private String inputString1;
    private String inputString2;
    private int expectedResult;
    private Utils utils;


    public UtilsTest2(String inputString1, String inputString2, int expectedResult) {
        this.inputString1 = inputString1;
        this.inputString2 = inputString2;
        this.expectedResult = expectedResult;
    }

    @Parameterized.Parameters
    public static Collection strings() {
        return Arrays.asList(new Object[][]{
                {"aaa", "aa", 2},
                {"ababab", "ab", 3},
                {"bbbb", "ab", 0},
                {"ab", "Ab", 0},
                {"", "nasim", 2000},
                {"", "nasim", 4}
        });
    }

    @Before
    public void initialize() {
        utils = new Utils();
    }

    @Test(timeout = 50)
    public void testGetCount() {
        System.out.println("Parameterized String is : " + inputString1 + " & " + inputString2);
        assertEquals(expectedResult,
                utils.getCount(inputString1, inputString2));
    }
}